import React, { Component } from "react";

import "./App.css";

class App extends Component {
  constructor() {
    super();

    this.state = {
      mosters: [
        { id: 1, name: "Frankestein" },
        { id : 2,name: "Dracula" },
        { id: 3,name: "Zombie" },
      ],
    };
  }

  render() {
    return (
      <div className="App">
        {this.state.mosters.map((mosters) => (
          <h1 key = {mosters.id}>{mosters.name}</h1>
        ))}
      </div>
    );
  }
}

export default App;
